import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          id: 'mons_1',
          name: "Dracula",
        },
        {
          id: 'mons_2',
          name: "Zombie",
        },
        {
          id: 'mons_3',
          name: "Vampire",
        },
      ],
    };
  }

  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(response => console.log(response))
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster, pos) => (
          <h1 key={monster.id}>{monster.name}</h1>
        ))}
      </div>
    );
  }
}

export default App;
